import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

// import FacebookIcon from './facebook.svg'; // Replace with your actual SVG imports
// import TwitterIcon from './twitter.svg';
// import LinkedInIcon from './linkedin.svg';
// import InstagramIcon from './instagram.svg';

const Footer = () => {
  return (
    <footer className="footer">
      <Container>
        <Row>
          <Col md={6}>
            {/* <div className="footer-social">
              <a href="https://www.facebook.com">
                <img src={FacebookIcon} alt="Facebook" />
              </a>
              <a href="https://www.twitter.com">
                <img src={TwitterIcon} alt="Twitter" />
              </a>
              <a href="https://www.linkedin.com">
                <img src={LinkedInIcon} alt="LinkedIn" />
              </a>
              <a href="https://www.instagram.com">
                <img src={InstagramIcon} alt="Instagram" />
              </a>
            </div> */}
          </Col>
          <Col md={6}>
            <span><a href="/#">Security</a></span>
              <span><a href="/#">Terms and Privacy</a></span>
              <span><a href="/#">Privacy Policy</a></span>
              <span><a href="/#">Cookie Settings</a></span>
              <span><a href="/#">Status</a></span>
              <span>All Rights Reserved Â© monday.com</span>
              <span><a href="/#">Accessibility Statement</a></span>
          </Col>
        </Row>
      </Container>
    </footer>
  );
};

export default Footer;
